import React from 'react';
import { NavLink }  from 'react-router-dom';

const SignedOutLinks = () => {
  return (
    <ul className="right">
        <li><NavLink to='/'> Visiting Place </NavLink> </li>
        <li><NavLink to='/'> About </NavLink> </li>
    </ul>
  )
}

export default SignedOutLinks;
